import{WorkExperienceRepository}from"../../repository/work-experience-repository.js";import{Utility}from"../../shared/utility.min.js";class DatabaseExperienceGraphModel{getDatabaseExperience=()=>{const e=(new WorkExperienceRepository).getAll(),o={};for(const r of e){if(!r.database||0===r.database.length)continue;if(!r.period.from||!r.period.to)continue;const e=Utility.getNumberOfDays(r.period.from),t=Utility.getNumberOfDays(r.period.to)-e;for(const e of r.database)o[e]||(o[e]=0),o[e]+=t}return o}}export{DatabaseExperienceGraphModel};